MINI純正アクセサリーとしてＬＥＤドアプロジェクターが新発売。ドアを開くと自動的にドアエントランスライト（乗降補助ライト）が点灯し、MINI WINGマークやユニオンジャックなどのグラフィックが路面に一緒に投影されます。もちろんドアエントランスライトとして機能します。プロジェクターの先のスライド（ロゴフィルム）を差し替えることで、3種類(MINIロゴ/ユニオンジャック/JOHN COOPER WORKS)のグラフィックを楽しむことができます。<br><br>●ドアカーテシーランプ（ドアエントランスライト）●左右2個セット●ロゴフィルム：3種類(MINIロゴ/ユニオンジャック/JOHN COOPER WORKS)<br><br>※ドアエントランスライト(乗降補助ライト)装備車であれば装着可能です。<br><br>適合車種：ドアエントランスライト(乗降補助ライト)装備車※車両により装着できない場合があります。<br><br><br><br>ランプ、レンズ | LED<BR>※こちらの商品は代引き不可です<tr><td colspan="2">
